#include <bits/stdc++.h>
using namespace std;

class Solution
{
    struct NBR
    {
        int node;
        int dis; // distance
        NBR(int _node, int _dis) : node(_node), dis(_dis) {}
    };
    vector<vector<NBR>> adj;
    bool dfs(vector<int> &q, int curr, vector<bool> &visited)
    {
        if (curr == q[1])
        {
            return true;
        }
        for (auto u : adj[curr])
        {
            if (u.dis >= q[3] || visited[u.node])
            {
                continue;
            }
            visited[u.node] = true;
            if (dfs(q, u.node, visited))
            {
                return true;
            }
        }
        return false;
    }

public:
    vector<bool> distanceLimitedPathsExist(int n, vector<vector<int>> &edgeList, vector<vector<int>> &queries)
    {
        // Create adjlist
        adj.resize(n);

        for (vector<int> edg : edgeList)
        {
            NBR nbr(edg[1], edg[2]);
            adj[edg[0]].push_back(nbr);
            nbr.node = edg[0];
            adj[edg[1]].push_back(nbr);
        }
        
        for (vector<NBR> a : adj)
        {
            for (NBR m : a)
            {
                cout << "(" << m.node << ", " << m.dis << ") ";
            }
            cout << endl;
        }
        vector<bool> answers;
        for (vector<int> q : queries)
        {
            bool ans = false;
            for (auto u : adj[q[0]])
            {
                cout<<q.size()<<endl;
                if (u.dis >= q.at(2))
                {
                    continue;
                }
                vector<bool> visited(n, false);
                visited[q[0]] = true;
                if (ans = dfs(q, q[0], visited))
                {
                    break;
                }
            }
            answers.push_back(ans);
        }
        return answers;
    }
};
int main()
{
    Solution s;
    int n = 5;
    vector<vector<int>> edgelist = {{0, 1, 10}, {1, 2, 5}, {2, 3, 9}, {3, 4, 13}};
    vector<vector<int>> queries = {{0, 4, 14}, {1, 4, 13}};
    vector<bool> answers = s.distanceLimitedPathsExist(n, edgelist, queries);
    for (auto ans : answers)
    {
        cout << ans << endl;
    }
    return 0;
}
